const MainHome = () => {
  return (
    <main>
      <div className="container">
        <div className="home-main">
          <h1>من نحن</h1>
          <p>
            المركز العراقي الحكومي المتخصص لرعاية اطفال امراض التوحد وتأهيلهم
            بافضل الطرق والخبرات المتواجدة
          </p>
          <input type="submit" value="للدعم " />
        </div>
      </div>
    </main>
  );
};
export default MainHome;
